using Aplicacion.Helpers.Function;
using Aplicacion.Interfaces;
using Aplicacion.Interfaces.Repositories;
using Dominio.Entities.Qr;
using Dominio.Settings;
using Microsoft.Extensions.Options;
using ServicesUniQr;
using ServiceUniQr;
using System;
using static Dominio.Entities.Qr.ResponseXml;

namespace Aplicacion.Services.MethodsPayment
{
    public class PaymentQr : IPaymentQr
    {
        private readonly UniQRSettings _uniQRSettings;
        private readonly IManager _manager;
        private readonly IFunction _function;
        public PaymentQr(IOptions<UniQRSettings> options, IManager manager, IFunction function)
        {
            _uniQRSettings = options.Value;
            _manager = manager;
            _function = function;
        }

        public Signature GenerateQr(FcQrCliente fcQrCliente)
        {
            try
            {   
                RequestHeader requestHeader = new()
                {
                    Service = _uniQRSettings.GenerateQR,
                    User = _uniQRSettings.User,
                    Password = _uniQRSettings.Password
                };
                Item item = new()
                {
                    ItemDescription = fcQrCliente.QrDescripcion,
                    ItemValue = fcQrCliente.IdQrCliente.ToString()
                };
                Items items = new()
                {
                    Item= item
                };
                RequestGetQr requestGetQr = new()
                {
                    Account = _uniQRSettings.Account,
                    Amount = fcQrCliente.QrMonto.ToString(),
                    Currency = _uniQRSettings.Currency,
                    Reference = fcQrCliente.QrGlosa,
                    Valid = _uniQRSettings.Valid,
                    FormatQr = _uniQRSettings.FormatQr,
                    Items = items
                };
                RequestXml requestXml = new()
                {
                    requestGetQr = requestGetQr,
                    requestHeader = requestHeader
                };
                string xmlRequest = _function.SerializeToString(requestXml);
                string xmlSigned = _manager.KeyXml(xmlRequest, _uniQRSettings.CertificatePath, _uniQRSettings.KeyNameValue);
                string response = _manager.Conection(xmlSigned);
                Signature signatureMethod = _function.ConvertXmlToObject<Signature>(response);
                signatureMethod.Object.Response.ResponseHeader.Expiration = _function.DateExpirationQr(_uniQRSettings.Valid);
                //signature.Object.Response.ResponseHeader.ResultCode = "0000";
                //signature.Object.Response.ResponseHeader.Message = "QR Generado Exitosamente";
                //signature.Object.Response.ResponseData.DataQR = "data:image/png;base64,";
                return signatureMethod;
            }
            catch (Exception e)
            {
                throw e;
            }
        }
    }

}
